import { useState, useEffect } from 'react';
import useCart from 'store/cartStore';
import Head from 'next/head'
import Link from 'next/link';
import Image from 'next/image';
import React from 'react'
import styles from 'styles/Layout.module.css';
import Button from './Button';
import Cart from './Cart';
import Logo from './Logo';
import Underline from './Underline';
import fSVG from 'public/footer.svg';

const Layout = ({baseLayout, children}: {baseLayout?: boolean, children?: React.ReactNode}) => {
  const quantity = useCart((state: any) => state.quantity);
  const [totalCart, setTotalCart] = useState(0);

  useEffect(() => {
    setTotalCart(quantity);
  }, [quantity]);

  return (
    <>
      <Head>
        <title>Ribera</title>
        <meta name="description" content="Ribera restobar"/>
      </Head>

      { baseLayout ?
        (
        <div className={styles.layoutWrapper}>
          <header className={styles.header}>
            <Logo/>
            <div className={styles.navWrapper}>
              <nav className={styles.navigation}>
                <Link href={'/'}>Home</Link>
                <Link href={'/productos'}>Productos</Link>
                <Link href={'/'}>Env√≠os</Link>
                <Link href={'/'}>Sobre Nostros</Link>
              </nav>
              <Underline className={styles.underline}/>
            </div>
            <div className={styles.rightHeader}>
              <div className={styles.cartWrapper}>
                <Link href={'/carrito'}>
                 <Cart/>
                 {totalCart > 0 && <span className={styles.totalCart}>{totalCart}</span>}  
                </Link>
              </div>
              <Button type='button'>
                Log In
              </Button>
            </div>
          </header>
          <div className={styles.childrenWrapper}>
           {children && children}
          </div>
          <footer className={styles.footer} /*style={{backgroundImage: `url(${fSVG})`}}*/>
            <div className={styles.svgWrapper}>
              <Image src={fSVG} alt={'footerImage'} height={123}/>
            </div>
            <div className={styles.contactWrapper}>
              <div className={styles.contact}>
                <p className={styles.socialMediaParagraph}>
                  Nuestras redes
                </p>
                <div className={styles.socialMediaImages}>
                  <Link href={'https://www.instagram.com/ribera_bar/'}>
                   <InstagramSVG  /> 
                  </Link>
                  <WhatsappSVG />
                </div>
              </div> 
            </div>
          </footer>
        </div>
        )

      : {children} 
      }
    </>
  )
}

export default Layout;

